import React, {Link} from "react";
import "./styles/SPA.css";


function NavBar() {
	return (
		<div className="w3-bar w3-blue w3-large">
			<Link to="/companies" className="w3-bar-item w3-button w3-mobile">
				Our Companies
			</Link>
			<Link href="#about" className="w3-bar-item w3-button w3-mobile">
				About
			</Link>
			<Link to="#contact" className="w3-bar-item w3-button w3-mobile">
				Contact
			</Link>
			<Link to="#contact" className="w3-bar-item w3-button w3-right w3-mobile">
				Login
			</Link>
		</div>
	);
}
export default NavBar;
